import { PlusIcon } from "@heroicons/react/outline"

function Feed() {
    return (
        <div className="bg-gray-700 h-100 w-100">
            {/* Input */}
            <div className="py-1 px-0 w- 12 rounded-xl bg-cyan-400 justify-center flex items-center">
                    <PlusIcon className="h-10 w-10 text-white"/>
                    <span className="font-bold text-white">Add Blog</span>
                </div>
        </div>
    )
}

export default Feed
